% -------------------------------------------------------------------------

% -------------------------------------------------------------------------
% Figure export settings
% -------------------------------------------------------------------------
%   The following code sets some properties of the figure, so that it is
%   straight suitable for publication. You can modify alll of the following
%   properties accordinf to taste...
%
%   Help resources:
%       For figure, axes, etc. properties see:
%       Matlab help: Matlab -> Handle Graphics Property Browser -> Figure
%       Matlab help: Matlab -> Handle Graphics Property Browser -> Axes
%       check also teh "set" and "get" commands in Matlab help

% Get all needed object handles
fig.handles.axes     = get(fig.handles.figure,'CurrentAxes');
fig.handles.axes_pos = get(fig.handles.axes,  'position');

% Set X axis properties
h = fig.handles.axes;
set(h,'XScale'    , 'linear'           );  % {linear} | log
set(h,'Xgrid'     , 'on'               );  % on | {off}
set(h,'XTick'     , [ -pi  -pi/2   0   pi/2  pi]);
set(h,'XTickLabel', {'-p'; '-p/2'; '0'; 'p/2'; 'p'},'fontname','symbol');
set(h,'Xlim'      , [-1*pi 1*pi]       );

% Set Y axis properties
h = fig.handles.axes;
set(h,'Yscale'        , 'linear'         );   % {linear} | log
set(h,'Ygrid'         , 'on'             );   % on | {off}
set(h,'YTick'         , [ -1  -0.5  0  0.5   1]);
set(h,'YTickLabel'    , {'-1'; '-0.5'; '0'; '0.5'; '1'} );
set(h,'Ylim'          , [-1 1]       );


% Set figure properties
set(fig.handles.figure, 'PaperUnits', 'inches'); % normalized | {inches} | centimeters | points

% Correct the axes position and size manually, if needed
fig.handles.axes_pos(1) = fig.handles.axes_pos(1) + 0; % left   [PaperUnits]
fig.handles.axes_pos(2) = fig.handles.axes_pos(2) - 0.01; % bottom [PaperUnits]
fig.handles.axes_pos(3) = fig.handles.axes_pos(3) + 0.02; % widthh [PaperUnits]
fig.handles.axes_pos(4) = fig.handles.axes_pos(4) + 0.02; % height [PaperUnits]
h = fig.handles.axes;
set(h,'position', fig.handles.axes_pos);% axes size and position

% Set other axes properties
h = fig.handles.axes;
set(h,'Box'           , 'on');   % on | {off}
set(h,'LineWidth'     , 0.25);   % line width in points, 1 point = 1/72 inch


% Set exportfig tool options
% For help with options, see EXPORTFIG
fig.opts = struct(                  ...
    'bounds'        , 'tight'     , ...     % 'tight' | 'loose'
    'BoundsCode'    , 'internal'  , ...     % 'internal' | 'mcode'
    'Width'         , 3.5         , ...     % a positive scalar
    'LockAxes'      , 0           , ...     % 0 | 1
    'color'         , 'rgb'      , ...     % 'bw' | 'gray' | 'rgb' | 'cmyk'
    'FontMode'      , 'fixed'     , ...     % 'scaled' | 'fixed'
    'FontSize'      , 8           , ...     % a positive scalar
    'FontEncoding'  , 'adobe'     , ...     % 'latin1' | 'adobe'
    'Resolution'    , 300         , ...     % a positive scalar
    'Renderer'      , 'painters'  , ...     % 'painters' | 'zbuffer' | 'opengl'
    'SeparateText'  , 0             ...     % 0 | 1
);
